import React from "react";
import Child from "./Child";
import Card from "./Card";
import Path from "./Path";


import "bootstrap/dist/css/bootstrap.min.css"
function App() {

    const subject = "React";
    const sampleTag = <h3> 데이터 바인딩 연습중</h3>;
    const fruits = ["apple", "pineapple", 'banana', 'kiwi', 'mango']
    return (
        <div className = "container text-center">
            <h1>{subject} 공부를 시작합시다.</h1>
            {sampleTag}

            {fruits.map((item, index) => {
              return (<p>{index+1}번째 과일은 {item}입니다.</p>
              )
            })}
            <Child props = {"자식1"}/>
            <Child props = {"자식2"}/>
            <Child props = {"자식3"}/>
            <Child props = {"자식4"}/>
            <Child props = {"자식5"}/>
            <Child />

            <Card images = {"image1"}/>
            <Card images = {"image2"}/>
            <Card images = {"image3"}/>
            <Card images = {"image4"}/>
            <Card images = {"image5"}/>
            <Card />

            <Path 
                path = {"https://mblogthumb-phinf.pstatic.net/MjAyMzA0MTVfMTEy/MDAxNjgxNTMxOTUwMjYy.OOz8_eYGOArI8zAXd3Zj-niTNGXsb2T7r2uzGuwHwFwg.F8Ek8a91WNq-WtRZadNzprh_Y59g1ulKurPY-yDHQrYg.JPEG.johtaa27/resized_IMG_2671.jpg?type=w800"} 
                name = {"망곰"}
            />

            <Path 
                path = {"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRJms2RzpHENbGdBZMVt5llEKwaFBghMOPS0Q&usqp=CAU"} 
                name = {"망곰2"}
            />
        </div>
        // <div></div> 로 감싸주거나 그냥 태그를 이용하거나
        // <React.Fragment></React.Fragment>로도 감싸줄 수 있는데 이건 잘 안쓴다. 비용문제도 있음.
    );
}

export default App;
